  true,\n\t\"url\": null,\n\t\"notes\": \"This submission contains links to Geothermal
  Areas on OpenEI that were completed as part of an effort to gather clean, unbiased
  information on which to build geothermal drilling prospects.  The specific areas
  that were part of this focused effort, or *case studies*, are linked individually,
  and also available for download as a table in CSV format.nnThe Geothermal Areas
  exist live on OpenEI and are constantly evolving with updated information.  Snapshots
  of both the specific case study areas and of all geothermal areas on OpenEI, from
  the time of submission, have been included in CSV format.  For the most up-to-date
  information, please use the provided **All Geothermal Areas** link to view these
  on OpenEI.nnThis dataset also includes a link to the Geothermal Exploration Overview
  page on OpenEI, which provides exhaustive detail on the activities cataloged for
  these case studies and their references, as well as the technologies employed in
  each geothermal area.\",\n\t\"license_title\": \"Creative Commons Attribution\",\n\t\"extras\":
